import React, {memo} from 'react';
import styled from 'styled-components';

const SnsContainer = styled.div``;

const Sns = memo(() => {
  return (
    <SnsContainer>
        <div className='SNSWrap'>
        <h3>PAIK’S COFFEE SNS</h3>
            <p>#빽다방#빽다방신메뉴#빽다방이벤트</p>
            <hr />
        </div>
    </SnsContainer>
  );
});

export default Sns;
